let copy = {
    "Home": {
        "PreTitle": "Hi there, my name is",
        "Title": "Donia Amer",
        "Subtitle": "I build (and occasionally design) things for the web",
        "Blurb": "I’m a design oriented front-end developer that focuses on building immersive and accessible digital experiences"
    },
    "About": {
        "Title": "A little about me..",
        "Body": [
            "Hey there! I’m Donia, a computer engineer based in Toronto, Canada. Fueled by the challenge of solving complex problems and lots of iced coffee, I’m always inspired to build products that start with the user and ends with innovation.",
            "After graduating from York University and interning at IBM, I joined the front-end engineering team at Deloitte Digital, where I work on impactful projects and make ideas come to life!",
            "My current toolset includes React, Angular, Typescript, and other various frameworks and libraries related to them. "
        ]
    },
    "Portfolio": {},
    "Contact": {}
}

export default copy;
